    title: string;
    onStartGame: () => void;
};

const HomePage: React.FC<HomePageProps> = ({ title, onStartGame }) => {
    return (
        <div>
            <Center bg='tomato' h='100px' color='white'>
                <h1>{title}</h1>
                <Button colorScheme='teal' size='lg'>
                    Button
                </Button>
            </Center>

        </div>
    );
};


export default HomePage;
